import React from 'react'
import VideoItem from "./VideoItem";

const VideoList = props => {
    const videoList = props.images.map(image => {
        return <VideoItem key={image.id} image={image}/>
    })
    return <div className={"ui video-list"}> {videoList}</div>
}

export default VideoList
